    Row,
    Col,
    UncontrolledTooltip,
  } from "reactstrap";


  import {
    LineChart_ProductionTime, 
    LineChart_DefectRate,
    LineChart_Defects,
    LineChart_ProductionOutput, 
  } from "variables/charts.js";


const ProductionTime= ({title, LineChart_ProductionTime_Example1}) => {



    if (title == 2){
      return (
          <>
          <Col xs="12">
            <Card className="card-chart">
              <CardHeader>
                <Row>
                  <Col className="text-left" sm="6">
                    <CardTitle tag="h3">Production Time</CardTitle>
                  </Col>
                </Row>
              </CardHeader>
              <CardBody>
                <div className="chart-area">
                  <Line
                    data={LineChart_ProductionTime[LineChart_ProductionTime_Example1]}
                    options={LineChart_ProductionTime.options}
                  />
                </div>
              </CardBody>

            </Card>
          </Col>

   </>
      )
  }
    else{
    return (
        null


    );}
};

export default ProductionTime;
